<script type="text/javascript">
function mapInfo(x) {
	let popup = document.getElementById(x);
	popup.classList.toggle('show');
	let clear = document.getElementById('clear-container');
	clear.setAttribute('pointer-events', 'all');
	let rect = document.querySelectorAll('rect');
	for (let a = 0; a < rect.length; a++) {
	rect[a].classList.toggle('hide');
	rect[a].setAttribute('pointer-events','none');
	};
	clear.onclick = function () {
	popup.classList.toggle('show');
	for (let a = 0; a < rect.length; a++) {
	rect[a].classList.toggle('hide');
	rect[a].setAttribute('pointer-events','all');
	};
	clear.setAttribute('pointer-events','none');
	}
}
</script>

<g pointer-events="none"><foreignObject x="700" y="469" width="40%" height="95%"><span class="st6 map-info" id="readingroom-info"><p>The Reading Room is the type of space many people think of when imagining a university library, with furniture and lamps that give off the classic library vibe. Despite its look, the room still has modern amenities like USB ports and electrical outlets. The Reading Room is used as a quiet study space and the large tables make it easy for people to spread out or keep a lot of materials close to them as they work.</p></span></foreignObject></g>
<g id="readingroom" class="st4" onclick="mapInfo('readingroom-info')">
	<g id="Rectangle_1">
		<g>
			<rect x="956" y="469" class="st5" width="120" height="297"/>
		</g>
	</g>
</g>
<g pointer-events="none"><foreignObject x="398" y="86" width="40%" height="95%"><span class="st6 map-info" id="carrels-info"><p>The small rooms all along the walls on the 3rd, 4th, 6th, and 7th floors of McKeldin Library are called study carrels. They are individual, somewhat private study spaces where students can focus on their work. Some of the study carrels are available on a first-come, first-served basis, while others are available for people to reserve for either 4 hours or 8 hours at a time. They can be a great option for people who find it difficult to do their work in a more open or crowded environment.</p></span></foreignObject></g>
<g id="carrels" class="st4" onclick="mapInfo('carrels-info')">
	<g id="Rectangle_2">

			<rect x="398" y="86" class="st5" width="49" height="256"/>
		</g>
	</g>
</g>
<g pointer-events="none"><foreignObject x="700" y="279" width="40%" height="95%"><span class="st6 map-info" id="writingcenter-info"><p>The Undergraduate Writing Center is run by the university's English Department as a partnership with the library. Students can set up free appointments for tutoring or to get help at any stage of writing a paper. Consultants who work at the Writing Center are also students, and any undergraduate who is interested can apply for this paid position. There is also a Writing Center for graduate students on the 5th floor of McKeldin Library.</p></span></foreignObject></g>
